import React from "react";
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import Home from './Home'; // Assuming Home.js is in the same directory as App.js
import "./App.css";

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
          </ul>
        </nav>
      </div>
      {/* Route definitions */}
      <Route path="/" exact component={Home} />
    </Router>
  );
}

export default App;
